Sure, based on your description, here's a Solidity smart contract that would act similarly:

```Solidity
pragma solidity ^0.8.0;

contract MyContract {
    // This is the fallback function. It gets executed if no other function matches the called function.
    fallback() external {
        revert("Function does not exist");
    }
}
```

In this contract, any ether sent directly to the contract address will be rejected as the fallback function is not payable. Additionally, any function calls that do not match existing functions will also revert.
